DROP TABLE IF EXISTS `parcels`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `parcels` (
  `parcel_id` int unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int unsigned NOT NULL,
  `clients_number` int unsigned NOT NULL,
  `parcel_status` enum('Open','Ready for packing','Bill isued','Ready for shipment','Shipped') CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `parcel_weight` int unsigned NOT NULL,
  `shipping_agent` enum('USPS: EMS','USPS: Priority','Russian Post','First class') CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `parcel_warehouse_id` int unsigned DEFAULT '1',
  `parcel_address_id` int unsigned NOT NULL,
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  `modified_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`parcel_id`),
  UNIQUE KEY `clients_number` (`clients_number`),
  KEY `parcels_warehouse_id_fk` (`parcel_warehouse_id`),
  KEY `parcels_addresses_id_fk` (`parcel_address_id`),
  KEY `clients_parcels_idx` (`user_id`,`parcel_id`),
  CONSTRAINT `parcels_addresses_id_fk` FOREIGN KEY (`parcel_address_id`) REFERENCES `parcels_addresses` (`address_id`),
  CONSTRAINT `parcels_users_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`),
  CONSTRAINT `parcels_warehouse_id_fk` FOREIGN KEY (`parcel_warehouse_id`) REFERENCES `warehouses` (`warehouse_id`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
