DROP TABLE IF EXISTS `payments`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `payments` (
  `payment_id` int unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int unsigned NOT NULL,
  `clients_number` int unsigned NOT NULL,
  `payment_method` enum('Credit card','Paypal','QIWI','Yandex-Money','Promotion') CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `payment_status` enum('Received','Placed','Canceled','Refunded') CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `payment_amount` int unsigned NOT NULL DEFAULT '10',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  `modified_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`payment_id`),
  UNIQUE KEY `clients_number` (`clients_number`),
  KEY `clients_payments_idx` (`user_id`,`payment_id`),
  CONSTRAINT `payment_users_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=801 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
